// FormComponent.js
import React from 'react';
import { TextField, Grid, Typography } from '@mui/material';

const FormComponentAnesthesia = ({ index, subject, paperType, maxMarks, marksSecured, handleChange }) => {
  return (
    <Grid container spacing={2} sx={{ mb: 2, borderBottom: '1px solid #ccc', pb: 2 }}>
      <Grid item xs={1}>
        <Typography>{index}</Typography>
      </Grid>
      <Grid item xs={4}>
        <Typography>{subject}</Typography>
      </Grid>
      <Grid item xs={2}>
        <Typography>{paperType}</Typography>
      </Grid>
      <Grid item xs={2}>
        <TextField
          label="Max Marks"
          variant="outlined"
          size="small"
          fullWidth
          value={maxMarks}
          name="maxMarks"
          onChange={handleChange}
        />
      </Grid>
      <Grid item xs={3}>
        <TextField
          label="Marks Secured"
          variant="outlined"
          size="small"
          fullWidth
          value={marksSecured}
          name="marksSecured"
          onChange={handleChange}
        />
      </Grid>
    </Grid>
  );
};

export default FormComponentAnesthesia;
